import React, { useState } from "react";

const SideNavBar = () => {
  return (
    <div className="fixed left-0 top-0 h-full w-60 bg-gray-900 text-white shadow-lg flex flex-col">
      <div className="text-xl font-bold p-4 border-b border-gray-700">Menu</div>
      <ul className="flex-grow p-4 space-y-4">
        <li className="hover:bg-gray-700 p-2 rounded cursor-pointer">Home</li>
        <li className="hover:bg-gray-700 p-2 rounded cursor-pointer">
          Profile
        </li>
        <li className="hover:bg-gray-700 p-2 rounded cursor-pointer">
          Settings
        </li>
        <li className="hover:bg-gray-700 p-2 rounded cursor-pointer">Logout</li>
      </ul>
      <div className="p-4 border-t border-gray-700 text-sm text-center">
        &copy; 2024 Your Company
      </div>
    </div>
  );
};
export default SideNavBar;
